  \"2013-03-14T19:31:36.753496\",\n\t\"name\": \"aspen-delineation-inyo-national-forest-ds366\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The database represents delineations of
  known aspen stands where aspen assessments were collected in the Inyo National Forest,
  Inyo County, California. The Inyo National Forest assessed aspen as a part of the
  Terrestrial Ecological Unit Inventory (TEUI). This data were gathered during the
  summers of 2005. The purpose of the TEUIs is to identify ecological map units and
  ecological types and interpretations for ecosystem management and planning. The
  aspen are within the Potential Natural Vegetation (PNV) layer, which is a base layer
  of the TEUIs. Delineations of aspen stands were based on dominant vegetation types
  from aerial imagery and field verification. Potential Natural Vegetation (PNV) coverage
  for all lands within the Inyo National Forest, including Sierra and Humboldt-Toiyabe
  National Forest lands administered by the Inyo NF without regard to land ownership.
  The coverage does not include large blocks of private, state, county, Dept. of LA
  Water and Power, or other federal lands such as Long Valley, or the Owens Valley.
  Associated with this polygon layer is a point layer (INYO_NF_PTS) containing aspen
  stand assessments conducted in conjunction with the aspen stand delineations. Data
  Compilation: The Aspen Delineation Project (ADP) is a collaborative effort of the
  U.S. Forest Service's Pacific Southwest Region, the California Department of Fish
  and Games Resource Assessment Program, and the California Office of Bureau of Land
  Management. Principal Investigator for ADP is David Burton; visit: www.aspensite.org
  for more information regarding the ADP. The Department of Fish and Games, Resource
  Assessment Program compiled this information from the collaborating agencies and
  other researchers, and formatted the data into a common database for the purpose
  of facilitating access to data related to the conservation of Quaking Aspen in California.
  This information portal falls within the ADP goals to help agencies and land managers
  identify, map, treat,\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
